/*Crea la Base de Datos tema5 y la pone en uso*/
CREATE DATABASE IF NOT EXISTS tema5;
USE tema5;

CREATE TABLE IF NOT EXISTS `tema5`.`libros` (
  `ISBN` INT NOT NULL AUTO_INCREMENT,
  `titulo` VARCHAR(200) NOT NULL,
  `subtitulo` VARCHAR(200) NOT NULL,
  `descripcion` VARCHAR(100) NOT NULL,
  `autor` VARCHAR(100) NOT NULL,
  `editorial` VARCHAR(100) NOT NULL,
  `categoria` VARCHAR(100) NOT NULL,
  `portada` MEDIUMBLOB NOT NULL,
  `ejemplares_totales` INT NOT NULL,
  `ejemplares_disponibles` INT NOT NULL,
  PRIMARY KEY (`isbn`));
  
  /*USUARIOS*/
create table IF NOT EXISTS usuarios (
	dni VARCHAR(50),
	nombre VARCHAR(50),
	apellidos VARCHAR(50),
	edad INT,
	direccion VARCHAR(50),
	poblacion VARCHAR(50),
	telefono VARCHAR(50),
	email VARCHAR(50)
);
  
  /*Prestamos*/
CREATE TABLE IF NOT EXISTS `tema5`.`prestamos` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `ISBN` INT NOT NULL,
  `dni` VARCHAR(45) NOT NULL,
  `fecha_inicio` DATE NOT NULL,
  `fecha_fin` DATE NOT NULL,
  `estado` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`id`));
  
